import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css'

import StockList from './StockList.js'

function Bourse() {

    return (

    <div className="app">

        <div className="container">

            <div className="col-md-5 mt-5">

                <div className="card">

                    <StockList />

                </div>

            </div>

        </div>

    </div>     

    );

}

export default Bourse;
